import React, { Component } from 'react';

class imagefilter extends Component {
    render() {
        return (
            <div className='css-grid-filter'>
                <div>
                    <a href='#'>View all</a>
                    <a href='#'>ART FAIR</a>
                    <a href='#'>BIENNALE</a>
                    <a href='#'>EXHIBITION</a>
                    <a href='#'>METAVERSE</a>
                    <a href='#'>Online VR Exhibition</a>
                    <a href='#'>SHOW ROOM</a>
                </div>
            </div>
        );
    }
}

export default imagefilter;
